import React from 'react';
import './App.css';
import {Todolist} from "./Todolist";

const shapka1 = 'What to learn-1'
const shapka2 = 'What to learn-3'

function App() {
    return (
        <div className="App">
            <Todolist shapka={shapka1}/>
            <Todolist shapka={shapka2}/>
        </div>

    );
}

export default App;
